import {Link} from 'react-router-dom'

const Products = () => {
    return( 
    <section>
    <h2>The Products Page</h2>
    <ul>
        <li><Link to='/products/p1'>Product1</Link></li>
        <li>Product2</li>
        <li>Product3</li>
    </ul>
    </section>
    )
}

export default Products;
